import React, { useState } from 'react';

// import './components/register.css'
import "./App.css"


const App = () => {
  const [isFlipped, setIsFlipped] = useState(false);

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-200">
      <div className={`flip-container ${isFlipped ? 'flipped' : ''}`}>
        <div className="flipper">
          <LoginForm onRegisterClick={() => setIsFlipped(true)} />
          <RegisterForm onLoginClick={() => setIsFlipped(false)} />
        </div>
      </div>
    </div>
  );
};


const LoginForm = ({ onRegisterClick }) => {
  return (
    <div className="front bg-white p-8 rounded-xl shadow-md w-96">
      <h1 className="text-4xl mb-6 text-center font-bold">Welcome Back</h1>
      {/* ... Rest of your LoginForm code ... */}
      <div className="text-center mt-4">
        <p className="text-sm text-gray-600">
          Don't have an account?{' '}
          <button
            className="text-blue-500 hover:underline focus:outline-none"
            onClick={onRegisterClick}
          >
            Register here.
          </button>
        </p>
      </div>
    </div>
  );
};



const RegisterForm = ({ onLoginClick }) => {
  return (
    <div className="back bg-white p-8 rounded-xl shadow-md w-96">
      <h1 className="text-4xl mb-6 text-center font-bold">Register</h1>
      {/* ... Rest of your RegisterForm code ... */}
      <div className="text-center mt-4">
        <p className="text-sm text-gray-600">
          Have an account?{' '}
          <button
            className="text-blue-500 hover:underline focus:outline-none"
            onClick={onLoginClick}
          >
            Login Here
          </button>
        </p>
      </div>
    </div>
  );
};



export default App;
